import merchant from "../fixtures/Stage/merchant.json"
import parentPage from "./ParentPage";
import project from "../fixtures/Stage/project.json";
import feen from "../fixtures/Stage/feen.json";
import sub_Title from "../fixtures/Prod/sub_Title.json"

const pageTitleElement = '.page-title';
const widgetBlock = '.widget-block';
const sectionTitle = '.section-title';
const sectionBlock = '.section-block';
const subTitle = '.sub-title';
const importantText = '.important-text';

class ProjectsPage {

    checkButtonExist(button_name) {
        parentPage.isButtonExist(button_name);
    }

    enterTextInToInput(Input, text) {
        parentPage.getInput(Input).clear().type(text);
    }

    clickButton(name) {
        parentPage.clickButton(name);
    }

    closeAlert() {
        parentPage.closeAlert()
    }

    checkUrl(Url) {
        parentPage.checkUrl(Url)
    }

    checkPageTitle(title) {
        parentPage.isPageTitleExist();
        parentPage.checkText(title, pageTitleElement)
    }

    checkSectionTitle(title) {
        parentPage.isElementExist(sectionTitle);
        parentPage.checkText(title, sectionTitle);
    }

    checkInfoText(checkText) {
        parentPage.isElementExist('.section-block');
        // parentPage.checkText(checkText, noVerificationBlock);
        cy.get('.section-block').find('p').invoke('text').should((text) => {
            expect(text).to.eq(checkText);
        })
    }

    checkSectionBlock(section) {
        for (let i = 0; i < section.length; i++) {
            parentPage.isElementExist(sectionBlock, i);
            parentPage.checkText(section[i], subTitle, i);
        }
    }

    createProject() {
        // Create Project and Install the Can use cardtoken checkbox
        cy.request({
            method: 'POST',
            url: `https://account.stage.paydo.com/v1/apps/create`,
            headers: {
                token: merchant.token,
            },
            body: {
                "name": "MyNewProject" + " " + parentPage.getTime(),
                "info": "non-specialized wholesale trade",
                "site": "https://account.stage.paydo.com/my.new.project" + parentPage.getTime(),
                "ipn": "https://non-specialized wholesale trade",
                "logo": "data:image/jpeg;base64,",
                "logoSrc": "data:image/jpeg;base64,",
                "amountInfo": {
                    "minAmount": {
                        "value": 0.01,
                        "currency": "EUR"
                    },
                    "averageAmount": {
                        "value": 1000,
                        "currency": "EUR"
                    },
                    "maxAmount": {
                        "value": 10000,
                        "currency": "EUR"
                    },
                    "expectedVolume": {
                        "value": 10000,
                        "currency": "EUR"
                    }
                },
                "checkoutPageCustomization": {
                    "logoSrc": "data:image/jpeg;base64,"
                }
            }
        }).then((response) => {
            expect(response).property('status').to.equal(201);

            // Get identifier last project
            cy.request({
                method: 'GET',
                url: "https://admin.stage.paydo.com/v1/apps/filters?query[userIdentifier]=" + merchant.bussiness_account,
                headers: {
                    token: feen.token
                }
            }).then((response) => {
                expect(response).property('status').to.equal(200);
                expect(response.body).property('data').to.not.be.oneOf([null, ""]);
                let projident = response.body.data[0].identifier;

                // Install the Can use cardtoken checkbox
                cy.request({
                    method: 'POST',
                    url: "https://admin.stage.paydo.com/v1/apps/" + projident + "/update-manager",
                    headers: {
                        token: feen.token,
                    },
                    body: {
                        "name": "MyNewProject" + " " + parentPage.getTime(),
                        "info": "non-specialized wholesale trade",
                        "site": "https://account.stage.paydo.com/my.new.project" + parentPage.getTime(),
                        "ipn": "https://non-specialized wholesale trade",
                        "canUseCardToken": true,
                        "cashRegisterType": "default",
                        "midIdentifier": 0,
                        "logo": "data:image/jpeg;base64,",
                        "newStatus": null,
                        "logoSrc": "data:image/jpeg;base64,",
                        "amountInfo": {
                            "minAmount": {
                                "value": 0.01,
                                "currency": "EUR"
                            },
                            "averageAmount": {
                                "value": 1000,
                                "currency": "EUR"
                            },
                            "maxAmount": {
                                "value": 10000,
                                "currency": "EUR"
                            },
                            "expectedVolume": {
                                "value": 10000,
                                "currency": "EUR"
                            }
                        },
                        "checkoutPageCustomization": {
                            "logoSrc": "data:image/jpeg;base64,"
                        }
                    }
                }).then((response) => {
                    expect(response).property('status').to.equal(201)
                })
            })
        })
    }


    acceptProject() {
        // Get identifier last project
        cy.request({
            method: 'GET',
            url: "https://admin.stage.paydo.com/v1/apps/filters?query[userIdentifier]=" + merchant.bussiness_account,
            headers: {
                token: feen.token
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200);
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            let projident = response.body.data[0].identifier;

            // Accept project
            cy.request({
                method: 'POST',
                url: "https://admin.stage.paydo.com/v1/apps/" + projident + "/accept",
                params: {
                    "query[userIdentifier]": merchant.bussiness_account //    ?
                },
                headers: {
                    token: manajer.token
                }
            }).then((response) => {
                expect(response).property('status').to.equal(200);
                expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            })
        })
    }

    getInputProjectName() {
        return cy.get('#mat-input-4')
    }

    getInputSite() {
        return cy.get('#mat-input-5')
    }

    getInputDescription() {
        return cy.get('#mat-input-6')
    }

    getInputCallback() {
        return cy.get('#mat-input-7')
    }

    enterMinTransactionAmount(text) {
        cy.get('#mat-input-11').type(text)
    }

    enterAverageTransactionAmount(text) {
        cy.get('#mat-input-12').clear().type(text)
    }

    enterMaxTransactionAmount(text) {
        cy.get('#mat-input-13').clear().type(text);
    }

    enterExpectedMonthlyVolume(text) {
        cy.get('#mat-input-14').clear().type(text);
    }

    checkCreateProject() {
        cy.contains('div', 'Success').invoke('text').should((text) => {
            expect(text).to.eq('Success')
        })
    }

    checkStatusProject(code) {
        cy.request({
            method: 'GET',
            url: "https://account.stage.paydo.com/v1/apps/user-apps",
            headers: {
                token: merchant.token,
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200);
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            expect(response.body.data[0].status).to.eq(code)
        })
    }

    getInput(i) {
        return cy.get('#mat-input-' + i)
    }

    checkAlert(i, allert) {
            cy.get('#mat-error-' + i).invoke('text').should((text) => {
                expect(text).to.eq(allert)
            })
    }

    clickOutsideElement() {
        cy.get('[class="section-wrap"]').click();
    }

    rejectProject() {
        // Get identifier last project
        cy.request({
            method: 'GET',
            url: "https://account.stage.paydo.com/v1/apps/filters?query[userIdentifier]=" + merchant.bussiness_account,
            headers: {
                token: manajer.token
            }
        }).then((response) => {
            expect(response).property('status').to.equal(200);
            expect(response.body).property('data').to.not.be.oneOf([null, ""]);
            let projident = response.body.data[0].identifier;

            // Reject project
            cy.request({
                method: 'POST',
                url: "https://account.stage.paydo.com/v1/apps/" + projident + "/reject",
                headers: {
                    token: manajer.token
                }
            }).then((response) => {
                expect(response).property('status').to.equal(200);
                expect(response.body).property('data').to.not.be.oneOf([null, ""]);

            })
        })
    }

    checkStatusProjectUI(status) {
        cy.get('[class="mat-cell cdk-cell cdk-column-status mat-column-status ng-star-inserted"]').eq(0).invoke('text').should((text) => {
            expect(text).to.eq(status)
        })
    }

    attachLogo() {
        cy.get('input[class="ngx-file-drop__file-input"]').each((fileInput) => {
            cy.wrap(fileInput).attachFile("2.jpeg");
        });
    }

    checkValidationField() {
        for (let i = 0; i < 6; i++) {
            let number = project.number_input[i];
            let allert = project.number_allert[i];
            cy.get('#mat-input-' + number).click();
            cy.get('[class="section-wrap"]').click();
            cy.get('#mat-error-' + allert).invoke('text').should((text) => {
                expect(text).to.eq(' Field is required ');
            });
        }
    }

    checkButtonStatus(name, status) {
        parentPage.getButtonStatus(name, status)
    }


    checkWidgetBlock() {
        parentPage.isElementExist(widgetBlock);
    }


    checkImportantText(checkText) {
        parentPage.isElementExist(importantText);
        parentPage.checkText(checkText, importantText);
    }

    checkSubTitle(title) {
        for (let i = 0; i < title.length; i++) {
            parentPage.checkText(title[i], subTitle);
        }
    }
}



export default new ProjectsPage();